'use strict';

const assert = require('assert');
const _ = require('lodash');
const { lastSubstring } = require('./');

describe('#lastSubstring', () => {
  const tests = [
    {
      s: 'abab',
      result: 'bab',
    },
    {
      s: 'leetcode',
      result: 'tcode',
    },
    {
      s: 'aaa',
      result: 'aaa',
    },
    {
      s: 'aaaa',
      result: 'aaaa',
    },
    {
      s:
        '',
      result:
        '',
    },
  ];

  _.forEach(tests, ({ s, result }) => {
    it(`${s} -> ${result}`, () => {
      assert.deepStrictEqual(lastSubstring(s), result);
    });
  });
});
